import react from 'react'
import Filmsgroup from './Filmsgroup';

function Movies(){
    return(
      <div className="row">
      <Filmsgroup 
      info = {
    {
          img:'/images films/braveheart.jpg',
          title:'Brave Heart',
          description:'History film',

}
}
      />
       <Filmsgroup 
      info = {
    {
          img:'/images films/Gladiator.jpeg',
          title:'Gladiator',
          description:'History film',

}
}
 />
      
      </div>
    )
}
export default Movies;
